window.bookSummaryJSON = "<p>Ein is on a mission from God. A God of Death.<br> &nbsp;</p> <p>Time is up for the Emperor of Ten Kings and it falls to a murdered eight year old boy to render the judgement of a God. Ein knows he can't do it alone, but the empire is rife with heroes. The only problem; in order to serve, they must first die.<br> &nbsp;</p> <p>Ein has four legendary heroes in mind, names from story books read to him by his father. Now he must find them and kill them, so he can bring them back to fight the Reaper's war.</p>"; 
